import numpy as np

def create_prime_matrix(dim):
    n = dim * dim / dim
    primes = [True for i in range(n + 1)]
    p = 2
    while p * p <= n:
        if primes[p] == True:
            for i in range(p * p, n + 1, p):
                primes[i] = False
        p += 1
    prime_nums = []
    for p in range(2, n):
        if primes[p]:
            prime_nums.append(p)
    primes_matrix = np.array(prime_nums[:dim * dim]).reshape(dim, dim)
    return primes_matrix

